import React, { useState } from "react";
import {one} from './req.js'
const New = () => {
  const [materials, setMaterials] = useState('');

  return (
    <div>
      <select onChange={(e)=> {
          const selectedMat = e.target.value
          setMaterials(selectedMat)
      }}>
        {one.map((mat) => (
          <option value={mat.value}>
            {mat.label}
          </option>
        ))}
      </select>
      <h5>{materials.label}</h5>
      {materials}
    </div>
  );
};
export default New;
